-- ----------------------------
-- Table structure for visa_activity
-- ----------------------------
DROP TABLE IF EXISTS `visa_activity`;
CREATE TABLE `visa_activity`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'Primary key ID',
  `activity_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'Name of the activity',
  `activity_content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT 'Content of the activity',
  `open_time` datetime NULL DEFAULT NULL COMMENT 'Time when the activity is open',
  `close_time` datetime NULL DEFAULT NULL COMMENT 'Time when the activity closes',
  `activity_image` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'Illustration image for the activity',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'Created by user',
  `create_time` datetime NULL DEFAULT NULL COMMENT 'Creation time',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'Last updated by user',
  `update_time` datetime NULL DEFAULT NULL COMMENT 'Last update time',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'Remarks',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `idx_activity_name`(`activity_name` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = 'Table storing activity details' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of visa_activity
-- ----------------------------

-- ----------------------------
-- Table structure for visa_application
-- ----------------------------
DROP TABLE IF EXISTS `visa_application`;
CREATE TABLE `visa_application`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'Primary Key',
  `applicant_id` bigint NOT NULL COMMENT 'Applicant ID 申请人id',
  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Name as in Passport MRZ format',
  `matric_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Matric Number',
  `passport_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Passport Number',
  `email` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Email Address',
  `malaysia_address` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Full Address in Malaysia',
  `overseas_address` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Full Address Overseas',
  `course_level` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Course Level',
  `nationality` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Nationality',
  `mobile_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Mobile Number (WhatsApp)',
  `application_location` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Location when applying',
  `course_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Course Name',
  `faculty_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Faculty/Institute/School Name',
  `supervisor_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Supervisor/Advisor Name',
  `sponsorship_status` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'Sponsorship status',
  `study_status` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Study Status (Current semester)',
  `marital_status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Marital Status',
  `date_of_birth` date NOT NULL COMMENT 'Date of Birth',
  `current_pass_validity` date NOT NULL COMMENT 'Validity Date of Current Pass',
  `travel_document_issue_date` date NOT NULL COMMENT 'Travel Document Issued Date',
  `travel_document_expiry_date` date NOT NULL COMMENT 'Travel Document Valid Until',
  `last_entry_date` date NOT NULL COMMENT 'Latest date enter Malaysia',
  `travel_document_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Travel Document (Passport) Type',
  `current_pass_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Type of Current Pass',
  `insurance_company` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'Insurance Cover Note Company',
  `status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'SUBMITTED' COMMENT 'Application Status: SUBMITTED, UNDER_REVIEW, APPROVED, REJECTED',
  `reviewer_id` bigint NULL DEFAULT NULL COMMENT 'Reviewer ID',
  `remarks` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT 'Remarks (including rejection reasons)',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Created Time',
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Updated Time',
  `boarding_pass_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `passport_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `old_passport_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `registration_slip_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `academic_result_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `attendance_report_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `progress_report_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `supporting_letter_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `emgs_payment_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `upm_payment_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `insurance_cover_note_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_applicant_id`(`applicant_id` ASC) USING BTREE,
  INDEX `idx_reviewer_id`(`reviewer_id` ASC) USING BTREE,
  INDEX `idx_status`(`status` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'Visa Application Form' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of visa_application
-- ----------------------------

-- ----------------------------
-- Table structure for visa_appointment
-- ----------------------------
DROP TABLE IF EXISTS `visa_appointment`;
CREATE TABLE `visa_appointment`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'Primary key ID',
  `activity_id` bigint NULL DEFAULT NULL COMMENT 'ID of the related activity',
  `appointment_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'Name of the appointment',
  `user_id` bigint NULL DEFAULT NULL COMMENT 'User ID',
  `user_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'Name of the user',
  `appointment_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'Time of the appointment',
  `role_id` bigint NULL DEFAULT NULL COMMENT 'Role of the user making the appointment',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'Created by user',
  `create_time` datetime NULL DEFAULT NULL COMMENT 'Creation time',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'Last updated by user',
  `update_time` datetime NULL DEFAULT NULL COMMENT 'Last update time',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'Remarks',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `appointment_name`(`appointment_name` ASC) USING BTREE,
  INDEX `visa_appointment_ibfk_1`(`activity_id` ASC) USING BTREE,
  CONSTRAINT `visa_appointment_ibfk_1` FOREIGN KEY (`activity_id`) REFERENCES `visa_activity` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `visa_appointment_ibfk_2` FOREIGN KEY (`appointment_name`) REFERENCES `visa_activity` (`activity_name`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 32 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = 'Table storing appointment details' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of visa_appointment
-- ----------------------------

